-- ----------------------------
-- Table structure for nhr_qualification
-- ----------------------------
DROP TABLE IF EXISTS `nhr_qualification`;
CREATE TABLE `nhr_qualification` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`type`  tinyint(4) NULL DEFAULT NULL COMMENT '证件类型 1学业证书2技能培训3其他4经纪人助理证书5全国经纪人证6全国协理证7地方证书' ,
`worker_id`  varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '员工id' ,
`name`  varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '证书名称' ,
`number`  varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '证书编号' ,
`issu_time`  datetime NULL DEFAULT NULL COMMENT '发证日期' ,
`begin_time`  datetime NULL DEFAULT NULL COMMENT '开始时间' ,
`end_time`  datetime NULL DEFAULT NULL COMMENT '结束时间' ,
`continuing_education_time`  datetime NULL DEFAULT NULL COMMENT '继续教育时间' ,
`insert_time`  timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间' ,
`BI_DATE`  timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP ,
`city_id`  varchar(56) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '城市ID' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8mb4 COLLATE=utf8mb4_general_ci
COMMENT='专业证书'
AUTO_INCREMENT=21223

